            <video className = "video" src={coverVideo} autoPlay loop muted />
            <h1>Darnell Armas</h1>
            <p>Developer | IT Student  | Freelancer</p>
            <a
                href=""
                target="_blank"
                rel="noreferrer"
                className="btn btn-primary mt-2"
